import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  flex-direction: column;
  min-height: 100vh;
  background-color: aliceblue;
  align-items: center;
`;

export const Header = styled.div`
  display: flex;
  height: 100px;
  align-items: center;
  width: 80%;
  background-color: blue;
`;

export const Body = styled.div``;
